import React from 'react'


function Proyectos() {

  const proyectos = [
    {
      id: 1,
      titulo: 'Proyecto 1',
      descripcion: 'Descripcion del Proyecto 1.',
      imagen: './carrito.png',
      enlace: 'enlace del proyecto',
    },
    {
      id: 2,
      titulo: 'Proyecto 2',
      descripcion: 'Descripcion del Proyecto 2.',
      imagen: './home.png',
      enlace: 'enlace del proyecto2',
    },
    {
      id: 3,
      titulo: 'Proyecto 3',
      descripcion: 'Descripcion del Proyecto 3.',
      imagen: './login.png',
      enlace: 'enlace del proyecto3',
    }
  ]
    return (
    <div className="proyectos-container">
      <div className='proyectos'>
      {proyectos.map((proyecto) => (
        <div key={proyecto.id} className='proyecto-card'>
          <img src={proyecto.imagen} alt={proyecto.titulo} />
          <h3>{proyecto.titulo}</h3>
          <p>{proyecto.descripcion}</p>
          <a href={proyecto.enlace} target='_blanck' rel='noopener nonreferrer'>
            Ver Proyecto
          </a>
        </div>  
      ))}
      </div>
    </div>
    )
      }

export default Proyectos;
